import { Router } from "express";
const mongoose = require("mongoose");

const Products = mongoose.model("products");

export const createProduct = async (req, res, next) => {
  const { name, desscriptionOne, desscriptionTwo, category } = req.body;

  const product = new ShoppingLists({
    name,
    desscriptionOne,
    desscriptionTwo,
    _category: category,
    dateAdded: Date.now(),
    dateModified: Date.now(),
  });

  await product.save();

  res.send({ product: product });
  next();
};

export const getProduct = async (req, res, next) => {
  const product = await Products.find({
    _products: req.body.id,
  });

  res.send({ product: product });
  next();
};

export const getAllProducts = async (req, res, next) => {
  const products = await Products.find();

  res.send({ products: products });
  next();
};

export const replaceProduct = async (req, res, next) => {
  const { name, desscriptionOne, desscriptionTwo, category } = req.body;

  const updatedProduct = await ShoppingLists.updateOne(
    { _id: req.body.id },
    {
      $set: {
        name: name,
        desscriptionOne: desscriptionOne,
        desscriptionTwo: desscriptionTwo,
        _category: category,
      },
    }
  );

  res.send({ product: updatedProduct });
  next();
};

export const deleteProduct = async (req, res, next) => {
  await Products.deleteOne({ _products: req.body.id });

  res.send("Record deleted");
  next();
};

const router = Router();

router.post("/products", createProduct);
router.get("/products", getAllProducts);
router.get("/products/:productId", getProduct);
router.put("/products/:productId", replaceProduct);
router.delete("/products/:productId", deleteProduct);

export default router;

